//For joining the tournament
import React from 'react';
import { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function Jointour(){
    return (
        <div>
            <h1>Want To Join A Tournament?</h1>
            <h3>Click on any of the tournaments below!</h3>
            <p>Need to add a list of events here now, but we need to
                <span> be able to update them on our database instead</span>
            </p>
        </div>
    )
}

export default Jointour;
